  array('id' => '0b000b09-290a-4f9b-8c34-f5b92378d1a8','name' => 'Super Mario Star Road','slug' => 'super-mario-star-road','description' => '[{"id":"PTgwilPLTE","type":"paragraph","data":{"text":"<b>Super Mario Star Road</b> is a ROM hack made by Skelux.\\n It was released around Christmas 2011, and contains 130 Stars. It is \\nconsidered to be one of the most famous SM64 ROM hacks, and has amassed \\nwidespread popularity among the SM64 ROM hacking community.\\n"}},{"id":"iV7HFN_Hj4","type":"paragraph","data":{"text":"It promises itself to be \\"sequel\\" to the original Super Mario 64, with a slight increase in difficulty. \\n"}},{"id":"89cD3S8QjY","type":"paragraph","data":{"text":"Amongst other changes, a variety of music has been replaced or \\nredone, with many new tracks being sourced from other games. New \\ntextures have been added and others replaced which, like the music, are \\nlargely sourced from other games the same era as Super Mario 64. The \\ncourse entrances range from simple warp pipes or paintings to more \\nunconventional entrances, such as a vase or a painting easel. \\n"}},{"id":"J163-epcn1","type":"paragraph","data":{"text":"Furthermore, all but one of the bosses have been replaced; instead of fighting Bowser at the end of every Bowser Level (excluding the final Bowser Level, in which Mario <i>does</i>\\n fight Bowser), he must fight what are referred to as the Pernicious \\nPiranha Plants in Bowser\'s Slippery Swamp, and the Blueberry Bully in \\nRetro Remix Castle.\\n"}}]','videolink' => NULL,'difficulty' => '0','peak' => '0','megapack' => '1','verified' => '1','rejected' => '0','created_at' => '2020-03-21 07:24:37','updated_at' => '2024-09-03 15:26:01'),
