  array('id' => '3068fdf3-f1c8-4bf7-bfd9-3a48edd910ab','name' => 'SM64 Madness','slug' => 'sm64-madness','description' => '[{"id":"x6pFxkVNzE","type":"paragraph","data":{"text":"\\"<i>this games kinda bad, it was done in less than 2 weeks with 122 \\nStars and i dont even have the file for it anymore... dont even bother.</i>\\" - Kaze Emanuar\\n"}},{"id":"6wiuHmB8KJ","type":"paragraph","data":{"text":"<b>SM64 Madness</b> is a major ROM hack created by Kaze Emanuar\\n (formerly KazeBG0) on November 2012. This hack marks Kaze Emanuar\'s \\nromhacking debut and was reputed to be relatively bad for its lack of \\nlevel design and awful difficulty curve. While filled with over 15 \\nlevels and 122 Stars, it also contains a broken camera control, terrible\\n soundtrack, obnoxious design visuals and, BEWARE, very mature and \\nprofanity in dialogue boxes.\\n"}},{"id":"WjGnFbmWCz","type":"paragraph","data":{"text":"A QoL update patch is planned out soon by Mushie64 to fix all issues as seen across the game. \\n"}}]','videolink' => NULL,'difficulty' => '0','peak' => '0','megapack' => '0','verified' => '1','rejected' => '0','created_at' => '2020-03-21 07:19:47','updated_at' => '2024-09-03 16:49:29'),
