  array('id' => '3bb08341-ef5b-49f7-a205-e6f7d6e2fdd6','name' => 'Kaizo Mario 64','slug' => 'kaizo-mario-64','description' => '[{"id":"gR2Y4MqbRs","type":"paragraph","data":{"text":"<b>Kaizo Mario 64</b> is a ROM hack made by OmegaEdge29 in 2009. It \\ncontains 120 Stars and requires Mario to collect every last Star before \\nhe can enter the final stage, Bowser in the Sky. As the name suggests, \\nthis hack is intended to be a much more difficult version of the game \\n(though nowhere near as difficult as some other hacks, such as <a href=\\"https://www.sm64romhacks.com/hacks/star-revenge-2-act-2-night-of-doom\\">Star Revenge 2: Night of Doom</a>, or <a href=\\"https://www.sm64romhacks.com/hacks/super-mario-treasure-world\\">Super Mario Treasure World</a>).\\n"}},{"id":"23L7WX37Lc","type":"paragraph","data":{"text":"This hack does not alter the level geometry of any of the stages,\\n but instead adds difficulty by moving, adding, and replacing the \\nobjects within the stages. In general, this hack was not designed with \\nglitches in mind, so many Stars can be collected easily with trivial \\nglitches or skips.\\n"}}]','videolink' => NULL,'difficulty' => '0','peak' => '0','megapack' => '0','verified' => '1','rejected' => '0','created_at' => '2020-03-21 07:10:32','updated_at' => '2024-09-03 15:20:03'),
