  array('id' => '3f9085a3-8428-49f2-9158-e907b9e1fdf3','name' => 'Super Mario 74','slug' => 'super-mario-74','description' => '[{"id":"6BGzEkZvJ-","type":"paragraph","data":{"text":"<b>Super Mario 74</b> is a ROM hack created by Lugmillord. It was \\nreleased in June 2011 and contains 151 Stars. The difficulty is amped \\nup, but not so much to the point of ruining the fun. \\n"}},{"id":"i9DPmeG9SZ","type":"paragraph","data":{"text":"Moreover, the creator made an even harder version called <a href=\\"https://www.sm64romhacks.com/hacks/super-mario-74-extreme-edition\\">Super Mario 74 Extreme Edition</a> reusing levels from this game (replacing Champion\'s Challenge with Triarc-Bridge), but for the purpose of making them devilishly difficult.\\n"}},{"id":"lEO-ECOMzN","type":"paragraph","data":{"text":"The graphics are still the same as the original game, but there \\nare few changes like the music, though most of the tracks still stay the\\n same. The overworlds mostly contain pipes and instant warp zones hidden\\n inside the pseudo-paintings in order to transport between the levels.\\n"}},{"id":"SNyRrQOdBq","type":"paragraph","data":{"text":"This hack also has a very silly tone and is most likely meant to \\nbe a parody. The NPCs are there mostly for a quick laugh or joke, and \\ngetting a specific amount of Stars usually results in a message taunting\\n the player, saying that they\'re going too slow. Even some of the Star \\nnames are taunting the player, such as any of the ones that are simply \\ncalled \\"Secret...\\" or \\"Can You Find Me?\\". There are also some times that\\n the game mentions the original Super Mario 64 by name/game and breaks \\nthe fourth wall.\\n"}},{"id":"GKJqsBpsRw","type":"paragraph","data":{"text":"In January 2021, MarioCrash released a crossover of SM74 and \\nSM74EE, called Super Mario 74: Ten Years After, which introduces new \\nthemes for the levels, as well as new missions. It was made as a \\ncelebration of SM74\'s 10th anniversary in 2021.\\n"}}]','videolink' => NULL,'difficulty' => '0','peak' => '0','megapack' => '1','verified' => '1','rejected' => '0','created_at' => '2020-03-21 07:24:19','updated_at' => '2024-09-03 15:24:03'),
