  array('id' => '8095131c-924d-46f3-9ca5-5831cc3973eb','name' => 'Star Revenge Redone','slug' => 'star-revenge-redone','description' => '[{"id":"_oN6ZYux2E","type":"paragraph","data":{"text":"<b>Star Revenge 1.3: Star Revenge Redone </b>(formerly known as <i><b>Star Revenge Redone</b></i>) is a ROM hack made by BroDute released on February 10th, 2013 with 105 Stars. It is a substantial update of the original <a href=\\"https://www.sm64romhacks.com/hacks/star-revenge-1\\"><b>Star Revenge 1</b></a>.\\n It received its second update on June 17, 2013, which raised the Star \\ncount to 106 featuring graphical enhancements, and then finally its \\nthird update on September 13, 2022, which also raised the Star count to \\n111 with newer QoL features.\\n"}},{"id":"tHJxA-lER1","type":"paragraph","data":{"text":"In Redone, once Mario has collected all 100 Stars, he will get a \\npassword to open two files contained in the folder the hack came in. One\\n is the credits, and the other one is a letter from Bowser inviting \\nMario to fight him in his hexagon world. This allows Mario to ultimately\\n face Bowser and beat the game.\\n"}},{"id":"SeZzRl824_","type":"paragraph","data":{"text":"The substantial remake of Star Revenge Redone called <a href=\\"https://mario64hacks.fandom.com/wiki/Star_Revenge_1.5:_Star_Takeover_Redone\\"><b>Star Revenge 1.5: Star Takeover Redone</b></a> was released on August 14, 2015.\\n"}},{"id":"pjIUbLSQuH","type":"paragraph","data":{"text":"BroDute initially stated that this version of Star Revenge won\'t \\nbe updated anymore as Redone 2.0 was already considered the superior \\nversion. However, this has gotten BroDute\'s approval as LinCrash took \\nresponsibilities to update it on the v2.0 iteration of Redone 1.3.\\n"}}]','videolink' => NULL,'difficulty' => '0','peak' => '0','megapack' => '0','verified' => '1','rejected' => '0','created_at' => '2020-03-21 07:23:07','updated_at' => '2024-09-03 16:44:19'),
