  array('id' => 'dd23abda-7f97-41da-8c4e-2ac278d574f0','name' => 'Mario\'s Nightmare 64','slug' => 'marios-nightmare-64','description' => '[{"id":"_JB5vqIgca","type":"paragraph","data":{"text":"<b>Mario\'s Nightmare 64</b>&nbsp;is a ROM hack made by Apioeus. It was released in July 2012 and contains 140 Stars.\\n"}},{"id":"SG7fslUHOh","type":"paragraph","data":{"text":"This hack was considered as one of the hardest hacks of its time,\\n and infamously criticized for its cryptic gameplay design and cheap \\nscale of difficulty. Although a classic, it is widely known after <a href=\\"https://www.sm64romhacks.com/hacks/super-mario-74-extreme-edition\\">Super Mario 74 Extreme Edition</a> and <a href=\\"https://www.sm64romhacks.com/hacks/star-revenge-2-act-2-night-of-doom\\">Night of Doom\'s</a> wake.\\n"}},{"id":"ecl0bwTeuL","type":"paragraph","data":{"text":"A substantial update was released in the following year (v1.1), \\nthus containing minor HUD changes and a new overworld, while v1.2 \\ninclude fixed warps and text redaction.\\n"}},{"id":"yUIiZgyou5","type":"paragraph","data":{"text":"In 2022, it was announced a remastered version called <i><b>Mario\'s Nightmare 64: Redreamed</b></i> by Mariocrash, with many improvements, fixes and changes over the original hack. For now, production is still in the works.\\n"}}]','videolink' => NULL,'difficulty' => '0','peak' => '0','megapack' => '0','verified' => '1','rejected' => '0','created_at' => '2020-03-21 07:12:43','updated_at' => '2024-09-03 16:34:02'),
