  array('id' => 'efc02d05-043f-4781-8b2d-f595e20e4490','name' => 'Super Mario 64 - Twisted Adventures','slug' => 'super-mario-64-twisted-adventures','description' => '[{"id":"YP7H92r-U6","type":"paragraph","data":{"text":"<b>Super Mario 64: Twisted Adventures</b> is a ROM hack made by SomeRussianMarioDude. It was released in Fall 2012 and contains 151 Stars.\\n"}},{"id":"sPPnVGW0E6","type":"paragraph","data":{"text":"This hack was made in regard of <a href=\\"https://www.sm64romhacks.com/hacks/super-mario-74\\"><b>Super Mario 74</b></a>\'s\\n fame which most of the aesthetics and level ideas are based on. \\nHowever, it was criticized for being a knock off hack or being \\nlackluster with its concepts and visuals.\\n"}},{"id":"3kPlh-QZNY","type":"paragraph","data":{"text":"LinCrash,\\n who has worked on preservation updates before, has released two \\nversions: one in 2016 featuring fixed warps, visible secrets and a \\nparallel cam, then a recent version in 2024 which completes the hack \\nwith newer QoL changes such as extra fixed warps, non-stop Stars, 6/8 \\nreds, etc.\\n"}},{"id":"gi4RxsR6Sc","type":"paragraph","data":{"text":"In 2014, the infamous kaizo counterpart, <a href=\\"httphttps://www.sm64romhacks.com/hacks/super-mario-64-twisted-adventures-intense-challenges:.fandom.com/wiki/Twisted_Adventures:_Intense_Challenge\\"><b>Twisted Adventures: Intense Challenge</b></a>, was released as a demo, then revived into a full-length major hack by <a href=\\"https://mario64hacks.fandom.com/wiki/Tomatobird8\\">Tomatobird8</a> in 2019. \\n"}}]','videolink' => NULL,'difficulty' => '0','peak' => '0','megapack' => '0','verified' => '1','rejected' => '0','created_at' => '2020-03-21 07:23:56','updated_at' => '2024-09-03 16:47:55'),
